import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"
import HomePage from './Home/HomePage';
function App() {
  return (
    <div className="App">
        Hello Word
        <Router>
          <div className='page-container'>
              <Route path="/" element ={<HomePage/>}/>

          </div>
        </Router>
    </div>
  );
}

export default App;
